import { useState , useEffect } from 'react';


function useFetch({ url }) {
  const [data , setdata] = useState(null  );

  useEffect(() => {
    fetch(url)
      .then(res => res.json())
      .then(data => setdata(data))
  } , [url]);


  return (
    data
  );
}

export default useFetch
